import React, { useState } from "react";
function DenemeComponent(props) {

  const title = props.title;


function changeHandler()
{
console.log("deneme");
};

  return (
    <div>
      <h2>{title}</h2>
      <p>{props.amount}</p>
      <p>{props.date.toISOString()}</p>
      <ButtonComponent
       changeHandler = {changeHandler}
      />
    </div>
  );
}

